t; compute time: 594.09 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 54.14 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.7.0.87:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 60 &lt;/li&gt;\n          &lt;li&gt; Threads: 2400 &lt;/li&gt;\n          &lt;li&gt; Memory: 9.38 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+untagged.1.g608b984.dirty &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n###################################################################################################\n# Copyright (c) 2020-2022 Centre national de la recherche scientifique (CNRS)\n# Copyright (c) 2020-2022 Commissariat a l'\u00e9nergie atomique et aux \u00e9nergies alternatives (CEA)\n# Copyright (c) 2020-2022 Institut national de recherche en informatique et en automatique (Inria)\n# Copyright (c) 2020-2022 Universit\u00e9 Paris-Saclay\n# Copyright (c) 2020-2022 Universit\u00e9 de Versailles Saint-Quentin-en-Yvelines\n#\n# SPDX-License-Identifier: MIT\n#\n###################################################################################################\n\nfrom dask_interface import Deisa\n# from deisa import Deisa\nfrom dask.distributed import performance_report, wait\nimport os\nimport time\nimport numpy as np\n\nos.environ[\"DASK_DISTRIBUTED__COMM__UCX__INFINIBAND\"] = \"True\"\n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize Deisa\nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    results = []\n    for i in range(25):\n        \n        cpt = np.sum(gt[i])\n\n        s = client.persist(cpt, release=True)\n\n        results.append(client.compute(s))\n\n    del gt\n\n# Write the results\nwith open(\"results.log\", \"a\") as f:\n    result = [cpt.result() for cpt in results]\n    f.write(str(result))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1484","type":"DatetimeTickFormatter"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_alpha":{"value":0.1},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1151"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1172","type":"Rect"},{"attributes":{},"id":"1480","type":"AllLabels"},{"attributes":{},"id":"1318","type":"DatetimeTickFormatter"},{"attributes":{"range_padding":0},"id":"1111","type":"DataRange1d"},{"attributes":{"months":[0,6]},"id":"1332","type":"MonthsTicker"},{"attributes":{"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1308","type":"Line"},{"attributes":{"coordinates":null,"data_source":{"id":"1002"},"glyph":{"id":"1031"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1033"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1035"}},"id":"1034","type":"GlyphRenderer"},{"attributes":{"format":"0.0 b"},"id":"1177","type":"NumeralTickFormatter"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{"source":{"id":"1002"}},"id":"1035","type"
